    // ===== DIVAN (wall-clock) =====

    #[divan::bench]
    fn facet_format_jit_deserialize(bencher: Bencher) {
        bencher.bench(|| {
            black_box(
                format_jit::deserialize_with_fallback::<Vec<String>, _>(JsonParser::new(
                    black_box(JSON),
                ))
                .unwrap(),
            )
        });
    }

    #[divan::bench]
    fn facet_format_json_deserialize(bencher: Bencher) {
        bencher.bench(|| {
            black_box(facet_format_json::from_slice::<Vec<String>>(black_box(JSON)).unwrap())
        });
    }

    #[divan::bench]
    fn facet_json_deserialize(bencher: Bencher) {
        bencher
            .bench(|| black_box(facet_json::from_slice::<Vec<String>>(black_box(JSON)).unwrap()));
    }

    #[cfg(feature = "cranelift")]
    #[divan::bench]
    fn facet_json_cranelift_deserialize(bencher: Bencher) {
        let json_str = unsafe { std::str::from_utf8_unchecked(JSON) };
        bencher.bench(|| {
            black_box(
                facet_json::cranelift::from_str_with_fallback::<Vec<String>>(black_box(json_str))
                    .unwrap(),
            )
        });
    }

    #[divan::bench]
    fn serde_json_deserialize(bencher: Bencher) {
        bencher
            .bench(|| black_box(serde_json::from_slice::<Vec<String>>(black_box(JSON)).unwrap()));
    }

    // ===== GUNGRAUN (instruction counts) =====

    fn setup_jit() -> &'static [u8] {
        let _ = format_jit::deserialize_with_fallback::<Vec<String>, _>(JsonParser::new(JSON));
        JSON
    }

    #[gungraun::library_benchmark]
    #[bench::cached(setup = setup_jit)]
    fn gungraun_escaped_strings_facet_format_jit(json: &[u8]) -> Vec<String> {
        let parser = JsonParser::new(black_box(json));
        black_box(format_jit::deserialize_with_fallback::<Vec<String>, _>(parser).unwrap())
    }

    #[gungraun::library_benchmark]
    fn gungraun_escaped_strings_facet_format_json_deserialize() -> Vec<String> {
        black_box(facet_format_json::from_slice::<Vec<String>>(black_box(JSON)).unwrap())
    }

    #[gungraun::library_benchmark]
    fn gungraun_escaped_strings_facet_json_deserialize() -> Vec<String> {
        black_box(facet_json::from_slice::<Vec<String>>(black_box(JSON)).unwrap())
    }

    #[gungraun::library_benchmark]
    fn gungraun_escaped_strings_serde_json_deserialize() -> Vec<String> {
        black_box(serde_json::from_slice::<Vec<String>>(black_box(JSON)).unwrap())
    }

    #[cfg(feature = "cranelift")]
    fn setup_cranelift() -> &'static str {
        let json_str = unsafe { std::str::from_utf8_unchecked(JSON) };
        let _ = facet_json::cranelift::from_str_with_fallback::<Vec<String>>(json_str);
        json_str
    }

    #[cfg(feature = "cranelift")]
    #[gungraun::library_benchmark]
    #[bench::cached(setup = setup_cranelift)]
    fn gungraun_escaped_strings_facet_json_cranelift(json: &str) -> Vec<String> {
        black_box(
            facet_json::cranelift::from_str_with_fallback::<Vec<String>>(black_box(json)).unwrap(),
        )
    }
